              </svg> 
              <span>{cartTotalQuantity}</span>
              </Link>       
         </li>

      </ul>


      <button onClick={handleMenu} className='block md:hidden py-3 px-4 mx-2 rounded focus:outline-none hover:bg-gray-200'>
          <div className='w-5 h-1 bg-gray-600 mb-1'></div>
          <div className='w-5 h-1 bg-gray-600 mb-1'></div>
          <div className='w-5 h-1 bg-gray-600 mb-1'></div>

          <div className=' absolute top-0 -right-full h-screen w-8/12 bg-white border'> 

            <ul className='flex flex-col items-center w-full text-base cursor-pointer pt-10'>

            <li>
